div.note:
Företogs val af tre ledamöter för att deltaga i talmansöfverläggningarna;
och befunnos, efter valförrättningens slut, dertill hafva blifvit
utsedde:

n:o 2, af herr Nisser, om uteslutande eller nedsättning af det
utaf Kongl. Maj:t begärda extra anslag till skarpskytteväsendets
och skjutskicklighetens befrämjande;
